import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MovieList from './MovieList';
import Filter from './Filter';
import MovieDetails from './MovieDetails';
import MovieDescription from './MovieDescription';
import './App.css';

const App = () => {
  const [movies, setMovies] = useState([
    {
      title: 'Le Parrain - film 1972',
      description: 'En 1945, à New York, les Corleone sont une des cinq familles de la mafia. Don Vito Corleone, "parrain" de cette famille, marie sa fille à un bookmaker.',
      posterURL: 'https://cinemalegyptis.org/app/uploads/sites/2/2022/09/LE-PARRAIN-aff.jpg',
      rating: 4,
      trailerLink: 'https://www.youtube.com/watch?v=bmtuIhesQWA',
    },
    {
      title: 'The Big Lebowski (1998)',
      description: 'Directed by the Coen Brothers, this cult classic is a unique blend of comedy and mystery, revolving around a laid-back and eccentric character known as "The Dude" who becomes entangled in a case of mistaken identity.',
      posterURL: 'https://shotonwhat.com/images/0118715.jpg',
      rating: 3,
      trailerLink: 'https://www.youtube.com/watch?v=ngV0RBhGZmE',
    },
    {
      title: 'Pans Labyrinth (2006)',
      description: 'Directed by Guillermo del Toro, this dark fantasy film is set against the backdrop of post-Civil War Spain and follows a young girl who discovers a magical labyrinth with mythical creatures.',
      posterURL: 'https://m.media-amazon.com/images/M/MV5BNTkzOTk0ZDctOTM4MC00NDg5LWEyYjctODE3ZTlkM2Y4NzQ1XkEyXkFqcGdeQXVyNjI0MTA1MTM@._V1_.jpg',
      rating: 6,
      trailerLink: 'https://www.youtube.com/watch?v=AcHasH-nLhU',
    },
    {
      title: 'The Shawshank Redemption (1994)',
      description: 'Directed by Frank Darabont, this classic drama tells the story of a man wrongfully imprisoned and his journey to maintain hope and dignity within the confines of Shawshank State Penitentiary.',
      posterURL: 'https://nathanburgessinsights.files.wordpress.com/2020/09/img_2741.jpg',
      rating: 7,
      trailerLink: 'https://www.youtube.com/watch?v=PLl99DlL6b4',
    },
    {
      title: 'The Grand Budapest Hotel (2014)',
      description: 'Directed by Wes Anderson, this comedic and visually striking film follows the misadventures of a hotel concierge and his protégé as they become embroiled in a murder mystery',
      posterURL: 'data:image/jpeg;base64,',
      rating: 8,
      trailerLink: 'https://www.youtube.com/watch?v=1Fg5iWmQjwk',
    },
    {
      title: 'Inception (2010)',
      description: 'Directed by Christopher Nolan, this mind-bending science fiction film explores the concept of dreams within dreams, featuring an ensemble cast led by Leonardo DiCaprio.',
      posterURL: 'data:image/jpeg;base64,',
      rating: 5,
      trailerLink: 'https://www.youtube.com/watch?v=YoHD9XEInc0',
    },
    {
      title: 'FAST X',
      description: 'Dante va débusquer et traquer Dom et sa famille aux quatre coins du monde, de Los Angeles aux catacombes de Rome, du Brésil à Londres et de l’Antarctique au Portugal. De nouvelles alliances vont se forger et de vieux ennemis réapparaitre.',
      posterURL: 'data:image/jpeg;base64,',
      rating: 9.3,
      trailerLink: 'https://www.youtube.com/watch?v=aOb15GVFZxU',
    },
  ]);

  const [filteredMovies, setFilteredMovies] = useState(movies);
  const [pendingFilters, setPendingFilters] = useState({ title: '', rate: '' });

  const handleFilterChange = (filters) => {
    setPendingFilters(filters);
  };

  const handleReset = () => {
    setFilteredMovies(movies);
  };

  const handleConfirm = () => {
    const confirmed = movies.filter((movie) => {
      const decodedTitle = decodeURIComponent(movie.title);
      return (
        decodedTitle.toLowerCase().includes(pendingFilters.title.toLowerCase()) &&
        (!pendingFilters.rate || movie.rating >= pendingFilters.rate)
      );
    });

    setFilteredMovies(confirmed);
  };

  const addMovie = (newMovie) => {
    setMovies([...movies, newMovie]);
    setFilteredMovies([...movies, newMovie]);
  };

  return (
    <Router>
      <div className="app">
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Filter
                  onFilterChange={handleFilterChange}
                  onReset={handleReset}
                  onConfirm={handleConfirm}
                />
                <MovieList movies={filteredMovies} />
              </>
            }
          />
          <Route
            path="/movies/:title"
            element={({ match }) => {
              const selectedMovie = movies.find(
                (movie) => decodeURIComponent(movie.title) === match.params.title
              );
              return selectedMovie ? <MovieDetails movie={selectedMovie} /> : null;
            }}
          />
        </Routes>
      </div>
    </Router>
  );
};

export default App;